   - Ordered List:
     - Start with numbers followed by `.`

3. Links:
   - Inline links: `[Link Text](URL)`
   - Reference links: `[Link Text][id]` (where `[id]` is the id reference in the format `id: URL`)

4. Images:
   - Inline images: `![Alt Text](URL)`
   - Reference images: `![Alt Text][id]` (where `[id]` is the id reference in the format `id: URL`)

